'''),
    "firParkText" : MessageLookupByLibrary.simpleMessage('''In 1650 kocht het Koopmanshuis het land, een deel van het landgoed van Wester Craigs, nu bekend als de Glasgow Necropolis. Omdat de westkant rotsachtig was en niet kon worden ontwikkeld, werd het vervolgens beplant met sparren en werd het bekend als Fir Park. In 1804 begonnen de grove sparren in het park echter te sterven en werden vervangen door voornamelijk iepen en wilgen, en het gebied werd een Victoriaans park en arboretum. In 1825 werd in Fir Park de eerste steen van het John Knox-monument gelegd.
'''),
    "design" : MessageLookupByLibrary.simpleMessage('''Het ontwerp voor Glasgow Necropolis
'''),
    "designText1" : MessageLookupByLibrary.simpleMessage('''In 1831 schreef John Strang, Chamberlain in het Merchants 'House, "Necropolis Glasguensis" of "Gedachten over de dood en morele stimulans" en zei:
'''),
    "designTextItalics" : MessageLookupByLibrary.simpleMessage('''“Het Fir Park lijkt bewonderenswaardig aangepast voor een Pere la Chaise, die prachtig zou harmoniëren met het aangrenzende landschap en een plechtig en passend aanhangsel zou vormen van de eerbiedwaardige structuur (de kathedraal) ervoor, terwijl het een zeer gewilde accommodatie zal veroorloven. voor de hogere klassen, zou tegelijkertijd een onproductief bezit omzetten in een algemene en lucratieve bron van winst, in een liefdadigheidsinstelling ”zou het zijn“ respectvol zijn voor de doden, veilig en gezond voor de levenden, toegewijd aan het Genie van Herinnering en om religieus en moreel gevoel uit te breiden. ”
'''),
    "designText2" : MessageLookupByLibrary.simpleMessage('''The Merchants 'House vroeg architect David Hamilton, Stuart Murray, curator van de botanische tuinen en James Clelland, hoofdinspecteur van openbare werken, om een haalbaarheidsstudie te maken voor de vorming van de Glasgow Necropolis en in 1828 stemde het comité van directeuren van landerijen en steengroeven ermee in het voorstel. In 1831 werd in de kranten een wedstrijd uitgeschreven voor het ombouwen van het Fir Park tot een begraafplaats met 5 prijzen van £ 10 - £ 50. Zestien plannen werden ontvangen en ze werden tentoongesteld in de tentoonstellingsruimten van de Dilettante Society in Argyll Arcade. David Bryce uit Edinburgh won de eerste prijs en zijn broer John Bryce uit Glasgow tweede. De jury besloot echter dat het werk het beste zou worden uitgevoerd door een tuinarchitect. Als gevolg hiervan werd George Mylne hoofdinspecteur en tuinman en begon het werk.
'''),
    "victorian" : MessageLookupByLibrary.simpleMessage('''De Victoriaanse Necropolis van Glasgow
'''),
    "victorianText" : MessageLookupByLibrary.simpleMessage('''Deze begraafplaats was altijd bedoeld om interkerkelijk te zijn en de eerste begrafenis in 1832 was die van een jood, Joseph Levi, een juwelier. In 1833 was de eerste christelijke begrafenis van Elizabeth Miles, stiefmoeder van de hoofdinspecteur, George Mylne. Na 1860 zouden de eerste uitbreidingen naar het oosten en het zuiden de Ladywell-steengroeve in beslag nemen en in 1877 en 1892/3 werden de laatste uitbreidingen naar het noorden en zuidoosten gebouwd, waardoor de begraafplaats verdubbelde. De Necropolis is nu 15 hectare groot.

50.000 begrafenissen hebben plaatsgevonden op de Necropolis en de meeste van 3.500 graven zijn tot 14 voet diep gebouwd, met stenen muren en bakstenen muren. Op de top van de Necropolis werden graven uit de rotswand gestraald. In 1877 werd de Molendinar Burn, die onder de Brug der Zuchten liep, doorkruist. Deze brandwond waarin St. Mungo op zalm zou hebben gevist, bevindt zich nu ondergronds op weg naar de Clyde.

De Necropolis was een van de weinige begraafplaatsen die de doden bijhield, waaronder beroep, leeftijd, geslacht en doodsoorzaak. In juli 1878 laat het bezoekersboek zien dat 13.733 mensen de Glasgow Necropolis bezochten - 12.400 burgers en 1.333 andere bezoekers.

In 1966 schonk het Merchants 'House de Necropolis aan de gemeenteraad van Glasgow, die het nu beheert en onderhoudt. De banken en de grafrand zijn verwijderd en het grootste deel van het gebied is voor onderhoud bestemd. Er zijn hier monumenten ontworpen door grote architecten en beeldhouwers uit die tijd, waaronder Alexander ‘Greek’ Thomson, Charles Rennie Macintosh en JT Rochead, in elke architectonische stijl, gemaakt voor de prominente en rijke ondernemers van de ‘Second City of the Empire’.

De Glasgow Necropolis heeft nog steeds een geweldige sfeer en trekt nog steeds veel bezoekers, zowel lokaal als van over de hele wereld.'''),
